import React,{ Component } from 'react';
import {BrowserRouter,Route} from 'react-router-dom';
import StockItemHome from './stockcomponent/StockItemHome';
import StockItemsCreate from './stockcomponent/StockItemsCreate';
import StockItemsEdit from './stockcomponent/StockItemsEdit';
import StockItemsDetails from './stockcomponent/StockItemsDetails';
import StockItemNavBar from './stockcomponent/StockItemNavBar';
import I_OrderHome from './stockcomponent/I_OrderHome';
import I_OrderEdit from './stockcomponent/I_OrderEdit';
import I_OrderCreate from './stockcomponent/I_OrderCreate';
import SupplierDetails from './stockcomponent/SupplierDetails';
import SupplierEdit from './stockcomponent/SupplierEdit';

export default class App extends Component{
  render(){
    return (
     <BrowserRouter>
     <div className="container">

       <StockItemNavBar/>

       <Route path="/" exact component={StockItemHome}></Route>

       <Route path="/addstockitems" component={StockItemsCreate}></Route>

       <Route path="/editstockitems/:id" component={StockItemsEdit}></Route>

       <Route path="/stockitem/:id" component={StockItemsDetails}></Route>

       <Route path="/inventoryorder" component={I_OrderHome}></Route>

       <Route path="/addiorders" component={I_OrderCreate}></Route>

       <Route path="/inventoryordersedit/:id" component={I_OrderEdit}></Route>

       <Route path="/invsupplierDetails/:id" component={SupplierDetails}></Route>

       <Route path="/supplierEdit/:id" component={SupplierEdit}></Route>


     </div>
     </BrowserRouter>
    )
  }
}
